import styled from 'styled-components'
import { useState } from 'react'


const Button = styled.button`
  border-radius: 3px;
  border: 2px solid palevioletred;
  color: palevioletred;
  margin: 0 1em;
  padding: 0.25em 1em;
`

const Box = styled.div`
    border: solid;
    border-weight: 2px;
    border-radius: 10px;

    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;

    padding: 50px;
`


export const MainPanel = () => {

    let [formData, setFormData] = useState("");

    return(
        <Box>
            Hello, world! {formData}

            <input value={formData} onChange={(e) => setFormData(e.target.value)}></input>


            <Button>hello</Button>
        </Box>
    )
}
